import React from 'react'
import styled from 'styled-components'

export const TheHeader = () => {
  return (
    <Header>
      <img src='home/logo.png' alt='logo' />
    </Header>
  )
}


const Header = styled.div`
  background-color: #1447E6;
  color: white;
  text-align: center;
  // height: 10%;
`
